 (function (Scratch) {
    "use strict";
    const icon = "data:image/png;base64,"

    if (!Scratch.extensions.unsandboxed) {
        alert("Tobster Utils must run unsandboxed")
    }



    class Tobsterutils {
        getInfo() {
            return {
                id: "tobsterutils",
                name: "Tobster Utils",
                color1: "#06E19B",
                blockIconURI: icon,
                menuIconURI: icon,
                blocks: [
                    {
                        blockType: Scratch.BlockType.LABEL,
                        text: "Random"
                    },
                    {
                        opcode: "newline",
                        blockType: Scratch.BlockType.REPORTER,
                        text: "new line",
                        disableMonitor: true
                    },
                    {
                        opcode: "threejoinblock",
                        blockType: Scratch.BlockType.REPORTER,
                        text: "join [one][two][three]",
                        arguments: {
                            one: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "apple "
                            },
                            two: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "banana "
                            },
                            three: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "pear"
                            }
                        }
                    },
                    {
                        opcode: "booltonum",
                        blockType: Scratch.BlockType.REPORTER,
                        text: "[boolean] to a number",
                        arguments: {
                            boolean: {
                                type: Scratch.ArgumentType.BOOLEAN,
                            }
                        }
                    },
                    "---",
                    {
                        opcode: "returntrue",
                        blockType: Scratch.BlockType.BOOLEAN,
                        text: "true",
                        disableMonitor: true
                    },
                    {
                        opcode: "returnfalse",
                        blockType: Scratch.BlockType.BOOLEAN,
                        text: "false",
                        disableMonitor: true
                    },
                    {
                        opcode: "randombool",
                        blockType: Scratch.BlockType.BOOLEAN,
                        text: "random",
                        disableMonitor: true
                    },
                    "---",
                    {
                        opcode: "colorthingy",
                        blockType: Scratch.BlockType.REPORTER,
                        text: "[colour]",
                        arguments: {
                            colour: {
                                type: Scratch.ArgumentType.COLOR,
                                defaultValue: "#ff6600"
                            }
                        }
                    },
                    {
                        blockType: Scratch.BlockType.LABEL,
                        text: "Links"
                    },
                    {
                        opcode: "openurl",
                        blockType: Scratch.BlockType.COMMAND,
                        text: "open [url] in [neworcurrent]",
                        arguments: {
                            url: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "https://extensions.turbowarp.org/"
                            },
                            neworcurrent: {
                                type: Scratch.ArgumentType.STRING,
                                menu: "tabstuff"
                            }
                        }
                    },
                    {
                        opcode: "fetchopcode",
                        blockType: Scratch.BlockType.REPORTER,
                        text: "fetch [fetchurl]",
                        arguments: {
                            fetchurl: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "https://extensions.turbowarp.org/hello.txt"
                            }
                        }
                    },
                    {
                        blockType: Scratch.BlockType.LABEL,
                        text: "Browser Controls"
                    },
                    {
                        opcode: "alertopcode",
                        blockType: Scratch.BlockType.COMMAND,
                        text: "alert[whattoalert]",
                        arguments: {
                            whattoalert: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "Hello, World!"
                            }
                        }
                    },
                    {
                        opcode: "confirmopcode",
                        blockType: Scratch.BlockType.BOOLEAN,
                        text: "confirm[whattoconfirm]",
                        arguments: {
                            whattoconfirm: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "Are You Cool?"
                            }
                        }
                    },
                    "---",
                    {
                        opcode: "promptopcode",
                        blockType: Scratch.BlockType.REPORTER,
                        text: "prompt[whattoprompt]",
                        arguments: {
                            whattoprompt: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "What Your Name?"
                            }
                        }
                    },
                    {
                        opcode: "promptwithdefault",
                        blockType: Scratch.BlockType.REPORTER,
                        text: "prompt[whattoprompd]with default[defaultthing]",
                        arguments: {
                            whattoprompd: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "How are you?"
                            },
                            defaultthing: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "Good!"
                            }
                        }
                    },
                    {
                        text: "Extra Controls",
                        blockType: Scratch.BlockType.LABEL
                    },
                    // More Controls
                    {
                        opcode: "moreif",
                        blockType: Scratch.BlockType.CONDITIONAL,
                        text: [
                            "if[condi]then",
                            "else if[condi2]then",
                            "else"
                        ],
                        branchCount: 3,
                        arguments: {
                            condi: {
                                type: Scratch.ArgumentType.BOOLEAN
                            },
                            condi2: {
                                type: Scratch.ArgumentType.BOOLEAN
                            }
                        }
                    },
                    "---",
                    {
                        opcode: "testtruefalse",
                        blockType: Scratch.BlockType.REPORTER,
                        text: "if [test] is true, return[iftrue]else[iffalse]",
                        arguments: {
                            test: {
                                type: Scratch.ArgumentType.BOOLEAN,
                            },
                            iftrue: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "apple"
                            },
                            iffalse: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "banana"
                            }
                        }
                    },
                    {
                        text: "Console",
                        blockType: Scratch.BlockType.LABEL
                    },
                    {
                        opcode: "logblock",
                        blockType: Scratch.BlockType.COMMAND,
                        text: "log[logthis]",
                        arguments: {
                            logthis: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "Hello, World!"
                            }
                        }
                    },
                    {
                        opcode: "warnblock",
                        blockType: Scratch.BlockType.COMMAND,
                        text: "warn[warnthis]",
                        arguments: {
                            warnthis: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "Hello, World!"
                            }
                        }
                    },
                    {
                        opcode: "errorblock",
                        blockType: Scratch.BlockType.COMMAND,
                        text: "error[errorthis]",
                        arguments: {
                            errorthis: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "Hello, World!"
                            }
                        }
                    }
                ],
                menus: {
                    tabstuff: {
                        items: [
                            "new tab",
                            "current tab"
                        ]
                    }
                }
            };
        }


        newline() {
            return "\n"
        }

        threejoinblock(args) {
            return String(args.one) + String(args.two) + String(args.three)
        }

        booltonum(args) {
            return args.boolean ? 1 : 0;
        }

        returntrue() {
            return true
        }

        returnfalse() {
            return false
        }

        randombool() {
            return (Math.round(Math.random()) === 1);
        }

        testtruefalse(args) {
            return args.test ? args.iftrue : args.iffalse;
        }

        colorthingy(args) {
            return args.colour
        }

        openurl(args) {
            if (args.neworcurrent === "current tab") {
                window.location.replace(args.url)
            } else {
                window.open(args.url)
            }
        }

        fetchopcode(args) {
            return fetch(args.fetchurl)
            .then((response) => {
              return response.text();
            })
            .catch((error) => {
              console.error(error);
              return 'Uh oh! Something went wrong.';
            });
        }

        alertopcode(args) {
            alert(args.whattoalert)
        }

        confirmopcode(args) {
            return confirm(args.whattoconfirm)
        }

        promptopcode(args) {
            return prompt(args.whattoprompt)
        }

        promptwithdefault(args) {
            return prompt(args.whattoprompd, args.defaultthing)
        }

        moreif(args, util) {
            if (args.condi) {
                util.startBranch(1)
            } else if (args.condi2) {
                util.startBranch(2)
            } else {
                util.startBranch(3)
            }
        }

        logblock(args) {
            console.log(args.logthis)
        }

        warnblock(args) {
            console.warn(args.warnthis)
        }

        errorblock(args) {
            console.error(args.errorthis)
        }
    };
    Scratch.extensions.register(new Tobsterutils());
})(Scratch);
    